import React, { Component } from 'react'
import {Blog_Data} from './Data';
import { Blog_Left, Blog_Right } from './Cards';
export const Blog = () => (
    
        <div>
            <section>
                <div className="container">
                    <div className="row justify-content-center">
                  {Blog_Data.map((val) => {
                      return(
                          <Blog_Left
                          
                          imgsrc = {val.imgsrc}
                          title = {val.title}
                          pera = {val.pera}
                          
                          />
                      )
                  })}
                      
                    </div>
                </div>
            </section>
        </div>
    
)
